import React from 'react';
import "./news.scss"
import {Link} from "react-router-dom";
const LitleNews = ({data}) => {
    return (
        <div className="litle_news_2">
            <div className="litle_news_photo">
                <img src={data[5]}/>
            </div>
            <div className="litle_news_pub">
                <div className="litle_news_pub_man">
                    <img src="https://via.placeholder.com/50x50"/>
                    <div className="litle_news_pub_text">{data[0]}
                    </div>
                </div>
                <div className="litle_news_data">
                    <div className="litle_news_data1">
                        {/*иконка календаря*/}
                        <div className="litle_news_data_icon"/>
                        <div className="litle_news_data_text">{data[1]}
                        </div>
                    </div>
                </div>
            </div>
            <div className="litle_news_title">
                <div className="litle_news_title_text">{data[2]}</div>
                <div className="litle_news_title_desc">
                    {data[3]}
                </div>
            </div>
            <Link to={data[4]} className="litle_news_btn">
                <div className="litle_news_btn_text">Читать больше
                </div>
            </Link>
        </div>
    );
};

export default LitleNews;
